import Layout from '../components/MyLayout';
import Link from 'next/link';

const Content = () => {
    const router = useRouter();
    return (
      <>
        <h1>{router.query.title}</h1>
        <p>This is the blog post content.</p>
      </>
    );
  };
  const Page = () => (
    <Layout>
      <Content />
    </Layout>
  );
